<script type="module">
import {Runtime, Inspector} from "https://cdn.jsdelivr.net/npm/@observablehq/runtime@4/dist/runtime.js";
import define from "https://api.observablehq.com/d/622f7b4d4fd4b0a6.js?v=3";
new Runtime().module(define, name => {
  if (name === "title") return new Inspector(document.querySelector("#observablehq-title-cb52e099"));
  if (name === "desc") return new Inspector(document.querySelector("#observablehq-desc-cb52e099"));
  if (name === "viewof file1") return new Inspector(document.querySelector("#observablehq-viewof-file1-cb52e099"));

  if (name === "plot") return new Inspector(document.querySelector("#observablehq-plot-cb52e099"));

});
